import React from "react";
import { Table, Tooltip } from "antd";

const columns = [
  {
    title: "Solscan",
    dataIndex: "solscan_link",
    key: "solscan_link",
    render: (text) => (
      <a href={text} target="_blank" rel="noopener noreferrer">Solscan</a>
    ),
  },
  {
    title: "交易时间 (GMT+8)",
    dataIndex: "trade_time_gmt8",
    key: "trade_time_gmt8",
  },
  {
    title: "交易时间 (GMT+0)",
    dataIndex: "trade_time_gmt0",
    key: "trade_time_gmt0",
  },
  {
    title: "类型",
    dataIndex: "type",
    key: "type",
  },
  {
    title: "Token地址",
    dataIndex: "gmgn_link",
    key: "gmgn_link",
    render: (text, record) => (
      <a href={text} target="_blank" rel="noopener noreferrer">
        {record.token_mint_address}
      </a>
    ),
  },
  {
    title: "买入数量",
    dataIndex: "buy_amount",
    key: "buy_amount",
  },
  {
    title: "买入SOL金额",
    dataIndex: "buy_sol_amount",
    key: "buy_sol_amount",
  },
  {
    title: "买入价格",
    dataIndex: "buy_price",
    key: "buy_price",
    render: (text, record) => (
      <Tooltip title={`USD: ${record.buy_price_usd || '-'} (SOL/USD)`}>
        {text}
      </Tooltip>
    ),
  },
  {
    title: "卖出数量",
    dataIndex: "sell_amount",
    key: "sell_amount",
  },
  {
    title: "卖出SOL金额",
    dataIndex: "sell_sol_amount",
    key: "sell_sol_amount",
  },
  {
    title: "卖出价格",
    dataIndex: "sell_price",
    key: "sell_price",
    render: (text, record) => (
      <Tooltip title={`USD: ${record.sell_price_usd || '-'} (SOL/USD)`}>
        {text}
      </Tooltip>
    ),
  },
  {
    title: "套利盈亏",
    dataIndex: "arbitrage_profit_loss",
    key: "arbitrage_profit_loss",
  },
  {
    title: "套利价格变化",
    dataIndex: "arbitrage_price_change",
    key: "arbitrage_price_change",
  },
  {
    title: "套利交易量",
    dataIndex: "arbitrage_volume",
    key: "arbitrage_volume",
  },
];

const PriceTable = ({ data, loading }) => (
  <Table
    columns={columns}
    dataSource={data}
    loading={loading}
    rowKey={(record, idx) => record.solscan_link + idx}
    scroll={{ x: true }}
    pagination={{ pageSize: 20 }}
  />
);

export default PriceTable;
